import React from 'react';
import EventDetail from '../component/EventDetail/EventDetail';
import LocationTabs from '../component/Tabs/LocationTabs';
import BookingBox from '../component/BookingBox/BookingBox';

const Location = ()=>{
  
  return (
    <div className="LocationContainer" style={{display : 'flex' , height : '100vh', paddingLeft : '10%' , paddingRight:'10%'}}> 
      <div className='location-left-container' style={{display:"block" , float:'left' , width : '50%'  , height:'100%'}}>
        <div className='location-left-event-image' style={{width: '100%', margin:'10px' , height:'50%' }}>
                <img src='https://upload.wikimedia.org/wikipedia/commons/1/18/React_Native_Logo.png' style={{width : '100%' , height:'80%'}} alt = "image"/>
                <EventDetail /> 
        </div>    
        <div style = {{margin : '20px' , marginTop : '10%'}}>
        <LocationTabs/>
        </div>    
            
      </div>
      <div className='location-right-container' style={{float:'right' , width:'50%' , height:'100%'}}>
        <BookingBox/>
      </div>
    </div>
  );
} 

export default Location;
